    [],nt"revision_timestamp": "2016-07-15T04:25:16.712471",nt"name": "youth-risk-behavior-surveillance-system-yrbss",nt"isopen":
    true,nt"url": null,nt"notes": "<p>The Youth Risk Behavior Surveillance
    System (YRBSS) monitors 6 types of health-risk behaviors that contribute to the
    leading causes of death and disability among youth and adults, including: behaviors
    that contribute to unintentional injuries and violence; sexual behaviors that contribute
    to unintended pregnancy and sexually transmitted diseases (STDs), including HIV
    infection; alcohol and other drug use; tobacco use; unhealthy dietary behaviors;
    inadequate physical activity. YRBSS also measures the prevalence of obesity and
    asthma among youth and young adults. YRBSS includes a national school-based survey
    conducted by CDC and state, territorial, tribal, and local surveys conducted by
    state, territorial, and local education and health agencies and tribal governments.</p>n",nt"license_title":
